import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import Col from 'react-bootstrap/Col'
import Form from 'react-bootstrap/Form'
import { getTransactionOne } from '../../api'
import Navigator from '../../components/AdminNav'
import { error } from '../../components/toastr'
import { convertUtcTimeToLocalTime, getDateTime } from '../../utils'
import jsPDF from 'jspdf';
import 'jspdf-autotable';

class AdminTransactionReadForm extends Component {
    constructor(props) {
        super(props)
        this.state = {
            id: '',
            type: '',
            transport_fee: 0,
            created_at: '',
            updated_at: '',
            company: {
                id: '',
                name: ''
            },
            transaction_products: [],
            signed_name: '',
            total_price_before_vat: 0,
            total_price_after_vat: 0,
            tinggi: 11.69,
            lebar: '08.27',
        }
        this.generatePdf = this.generatePdf.bind(this)
    }

    componentDidMount() {
        const { id } = this.props.match.params
        getTransactionOne(id)
            .then(res => {
                this.setState(res.data)

            })
            .catch(err => {
                error('Hệ thống bị lỗi xin vui lòng thử lại!')
            })
    }

    generatePdf(e) {
        e.preventDefault();
        let max_row = 15

        let current_date = getDateTime(this.state.created_at)

        let colum_data = []
        this.state.transaction_products.map((transaction_product, idx) => {
            colum_data.push(
                {
                    stt: idx,
                    name: transaction_product.product_name,
                    total: transaction_product.total,
                    price: `${transaction_product.price} vnđ`,
                    total_price: `${transaction_product.total_price} vnđ`
                })
        })
        for (let i = colum_data.length; i < max_row; i++) {
            colum_data.push(
                {
                    stt: i, name: '', total: '',
                    price: '', total_price: ''
                })
        }

        var doc = new jsPDF();
        doc.setFontSize(12);
        doc.addFileToVFS('arial.ttf',
            '');

        doc.addFont('arial.ttf', 'custom-font', 'bold');
        doc.addFont('arial.ttf', 'custom-font', 'normal');
        doc.setFont('custom-font');

        // doc.setFont("custom-font");

        doc.text("CÔNG TY TNHH SX&TM THANH DUNG", 10, 20);
        doc.setFontSize(24);
        doc.text("PHIẾU GIAO HÀNG", 100, 20)
        doc.setFontSize(18);
        doc.text(`Số: ${this.state.id}`, 180, 20)
        doc.setFontSize(12);
        doc.text("ĐT: 028.38.104 - 0902.301.960", 10, 25);
        doc.text('Email: bongbongthanhdung@yahoo.com.vn', 10, 30);
        doc.setFontSize(11);
        doc.text(`Ngày ${current_date.getDate()} tháng ${current_date.getMonth() + 1} năm ${current_date.getFullYear()}`,
            140, 25);
        doc.setFontSize(12);
        doc.text(`Tên khách hàng: ${this.state.company.name}`, 10, 45)
        doc.text(`Địa chỉ: ${this.state.company.address}`, 10, 52)
        doc.text(`Theo đơn hàng số: ${this.state.id}`, 10, 59)
        doc.text(`Địa chỉ giao hàng: ${this.state.company.address}`, 10, 66)
        doc.autoTable({
            styles: { font: "custom-font" },
            headStyles: {
                font: "custom-font"
            },
            columns: [
                { header: 'STT', dataKey: 'stt' },
                { header: 'TÊN HÀNG', dataKey: 'name' },
                { header: 'SỐ LƯỢNG', dataKey: 'total' },
                { header: 'ĐƠN GIÁ', dataKey: 'price' },
                { header: 'THÀNH TIỀN', dataKey: 'total_price' },
            ],
            margin: { top: 75 },
            body: colum_data
        });

        doc.setFontSize(12);
        doc.text(`Tổng tiền hàng: ${this.state.total_price_before_vat} vnđ`, 140, 210)
        doc.text(`VAT 10%: ${this.state.total_price_after_vat - this.state.total_price_before_vat} vnđ`, 140, 217)
        doc.text(`Tổng cộng: ${this.state.total_price_after_vat} vnđ`, 140, 224)
        doc.text('Khách hàng', 60, 250)
        doc.text('Người viết hoá đơn', 130, 250)
        let sign_name = 65
        doc.text('(ký tên)', sign_name, 255)
        doc.text('(ký tên)', 140, 255)
        doc.setFontSize(11);
        doc.text(`${this.state.signed_name}`, Math.floor(140 - this.state.signed_name.length / 4), 265)

        let file_name = `hoa_don_${this.state.id}.pdf`
        doc.save(`${file_name}`)
    }
    ;

    render() {

        return (
            <div>
                <Navigator/>
                <Form
                >
                    <Form.Row>
                        <Form.Group md='3' as={Col} controlId="formGridName">
                            <Form.Label>Loại hoá đơn</Form.Label>
                            <Form.Control
                                disabled
                                type="text"
                                name='type'
                                value={this.state.type}
                            />
                        </Form.Group>
                    </Form.Row>
                    <Form.Row>
                        <Form.Group md='4' as={Col} controlId="formGridTaxNumber">
                            <Form.Label>Giờ tạo</Form.Label>
                            <Form.Control
                                disabled
                                type="text"
                                name="tax_number"
                                value={convertUtcTimeToLocalTime(this.state.created_at)}
                            />
                        </Form.Group>

                        <Form.Group md='4' as={Col} controlId="formGridPhone">
                            <Form.Label>Người kí tên</Form.Label>
                            <Form.Control
                                disabled
                                type="text"
                                name='signed_name'
                                value={this.state.signed_name}
                            />
                        </Form.Group>

                        <Form.Group md='4' as={Col} controlId="formGridCompanyName">
                            <Form.Label>Tên công ty</Form.Label>
                            <Form.Control
                                disabled
                                type="text"
                                name='company_name'
                                value={this.state.company.name}
                            />
                        </Form.Group>
                    </Form.Row>
                    <hr/>
                    {
                        this.state.transaction_products.map(transaction_product => {
                            return (
                                <Form.Row key={transaction_product.id}>
                                    <Form.Group md='3' as={Col} controlId="formGridBeforeVAT">
                                        <Form.Label>Sản phẩm</Form.Label>
                                        <Form.Control
                                            disabled
                                            type="text"
                                            name='product_name'
                                            value={transaction_product.product_name}
                                        />
                                    </Form.Group>
                                    <Form.Group md='3' as={Col} controlId="formGridBeforeVAT">
                                        <Form.Label>Giá</Form.Label>
                                        <Form.Control
                                            disabled
                                            type="number"
                                            name='price'
                                            value={transaction_product.price}
                                        />
                                    </Form.Group>
                                    <Form.Group md='3' as={Col} controlId="formGridBeforeVAT">
                                        <Form.Label>Số lượng</Form.Label>
                                        <Form.Control
                                            disabled
                                            type="number"
                                            name='total'
                                            value={transaction_product.total}
                                        />
                                    </Form.Group>
                                    <Form.Group md='3' as={Col} controlId="formGridBeforeVAT">
                                        <Form.Label>Tổng tiền</Form.Label>
                                        <Form.Control
                                            disabled
                                            type="number"
                                            name='total_price'
                                            value={transaction_product.total_price}
                                        />
                                    </Form.Group>
                                </Form.Row>
                            )
                        })
                    }
                    <hr/>
                    <Form.Row>
                        <Form.Group md='4' as={Col} controlId="formGridTransportFee">
                            <Form.Label>Tiền vận chuyển</Form.Label>
                            <Form.Control
                                disabled
                                type="number"
                                name='transport_fee'
                                value={this.state.transport_fee}
                            />
                        </Form.Group>
                        <Form.Group md='4' as={Col} controlId="formGridBeforeVAT">
                            <Form.Label>Tiền Trước VAT</Form.Label>
                            <Form.Control
                                disabled
                                type="number"
                                name='total_price_before_vat'
                                value={this.state.total_price_before_vat}
                            />
                        </Form.Group>
                        <Form.Group md='4' as={Col} controlId="formGridAfterVAT">
                            <Form.Label>Tiền Sau VAT</Form.Label>
                            <Form.Control
                                disabled
                                type="number"
                                name='total_price_after_vat'
                                value={this.state.total_price_after_vat}
                            />
                        </Form.Group>
                    </Form.Row>
                    <Button onClick={this.generatePdf}>Export PDF file</Button>
                </Form>
            </div>

        )
    }
}

export default AdminTransactionReadForm
